import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";

const Discover = () => {
  const [page, setPage] = useState(1);
  const [content, setContent] = useState({});

  const fetchTrending = async () => {
    let temp = {};
    const { data } = await axios.get(`/Assets/data.json`);

    data.users.apps.map((item) => {
      if (!item.catagories[0] in temp) {
        temp[item.catagories[0]] = [];
      }
      temp[item.catagories[0]].push(item);
    });

    console.log(temp);

    setContent(temp);
  };

  useEffect(() => {
    window.scroll(0, 0);
    fetchTrending();
    // eslint-disable-next-line
  }, [page]);

  return (
    <div>
      <span className="pageTitle">My Subscribed APPS</span>
      <div className="subscribe">
        {/* {content &&
          content.user.apps.map((app) => (
